  "button": "btn",
  "fab": "fab",
  "link": "link"
}

const ButtonColor = {
  "basic": "main",
  "primary": "primary",
  "secondary": "secondary",
  "success": "success",
  "warning": "warning",
  "danger": "danger",
  "high": "high",
